import React, { useEffect } from 'react';

const Logout = () => {

    useEffect(() => {
        const timer = setTimeout(() => {
            return (
                <div>
                    Logging out...
                </div>
            );
        }, 5000);
        return () => clearTimeout(timer);
      }, []);

}

export default Logout
